import React, { useState, useEffect } from 'react';

function Pokemon() {
    const [pokemon, setPokemon] = useState([])

    useEffect(() => {
        fetch("https://pokeapi.co/api/v2/pokemon/?limit=807")
        .then(response => {
            return response.json();
        }).then(response => {
            // console.log(response);
            setPokemon(...pokemon, [response.results])
        }).catch(err => {
            console.log(err);
        });
    }, [])


